// HasSeries applies the HasEdge predicate on the "series" edge.
func HasSeries() predicate.LatestSeries {
	return predicate.LatestSeries(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, SeriesTable, SeriesColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSeriesWith applies the HasEdge predicate on the "series" edge with a given conditions (other predicates).
func HasSeriesWith(preds ...predicate.Series) predicate.LatestSeries {
	return predicate.LatestSeries(func(s *sql.Selector) {
		step := newSeriesStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.LatestSeries) predicate.LatestSeries {
	return predicate.LatestSeries(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.LatestSeries) predicate.LatestSeries {
	return predicate.LatestSeries(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.LatestSeries) predicate.LatestSeries {
	return predicate.LatestSeries(sql.NotPredicates(p))
}
